import React from 'react';
// import { useContext } from 'react';
import { Routes, Route } from 'react-router-dom';
// import AuthContext from './store/auth-context';
import Layout from '../Layout/Layout';
import Header from '../Layout/Header';
import CameraView from '../Layout/Camera-view';
import RealtimeDisplay from '../Layout/Real-time-Display';
import Account from '../Layout/Account';
import RecordAnalysis from '../Layout/Record-analysis';
function ProfileForm() {
  // const authCtx = useContext(AuthContext);
  return (
    
      <Routes>
        <div className="flex h-screen">
            <Layout />
        <div className="flex-1 flex flex-col overflow-hidden">
          <Header /> {/* Add the Header component here */}
        
            <Route path="/record-analysis" element={<RecordAnalysis />} /> 
        
        <Route path="camera-view" element={<CameraView />} />
        
          
        
        <Route path="/Account" element={<Account />} />
        <Route path="/real-time-Display" element={<RealtimeDisplay />} />
        
       </div>
       </div>   
        
        
        
        
      </Routes>

    
      
    
  );
}

export default ProfileForm;
